import React from "react";
import { Link } from "react-router-dom";

function Navigation() {
    return (
        <nav className="navigation">
            <Link to="/" className="main-text">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/Portfolio">Portfolio</Link>
        </nav>
    )
}

export default Navigation;
